        console.log(error)
    })
    }

    handleChange(event) {
    this.setState({
        [event.target.name]: event.target.value
    })
    }
    render() {
        var msg = this.state.msg
        return (
            <div>
                <h3>{msg}</h3>
            </div>
        )
    }
}

export default Logout
